import React, { Component } from 'react';

export class issue_book extends Component {
    render() {
        return (
          <div>
            Issue book <br />
            var tempDate = new Date(); var date = tempDate.getFullYear() + '-' +
            (tempDate.getMonth()+1) + '-' + tempDate.getDate() +' '+
            tempDate.getHours()+':'+ tempDate.getMinutes()+':'+
            tempDate.getSeconds();
          </div>
        );
    }
}

export default issue_book;
